import React, { useState } from "react";
import {StyleSheet,View,Text,TextInput,Button} from "react-native";
import {Formik} from "formik";
import * as yup from"yup";
const ReviewSchema=yup.object({
    password:yup.string(),
    confirmpassword:yup.string(),
});
export default function Password({navigation})
{
    const [pword,setpword]=useState('');
    const onSubmitHandler=(val)=>{
        if(val.password!==val.confirmpassword)
        {
            alert("passwords dont match");
        }
        else
        {
            setpword(val.password);
            navigation.push('UserDetails');
        }
    }
    return (
        <Formik initialValues={{password:'',confirmpassword:''}}
            validationSchema={ReviewSchema}
            onSubmit={(values,actions)=>{
                // addreview(values);
                console.log(values);
                actions.resetForm();

            }}>
                {(props)=>(
                    <View >
                        <Text>Password</Text>
                        <TextInput  placeholder='password' value={props.values.password} onChangeText={props.handleChange('password')}/>
                        <Text>{props.touched.password && props.errors.password}</Text>
                        <Text> confirm Password</Text>
                        <TextInput  placeholder=' confirm password' value={props.values.confirmpassword} onChangeText={props.handleChange('confirmpassword')}/>
                        <Text>{props.touched.confirmpassword && props.errors.confirmpassword}</Text>
                        <Button  title="REGISTER" onPress={()=>{props.handleSubmit();onSubmitHandler(props.values)}}/>
                    </View>
                )}
        </Formik>
    );
}
